// SPDX-License-Identifier: MIT
pragma solidity ^0.8.8;

/// @title Criminal Data Sender Contract
/// @notice This contract allows for the creation, retrieval, and deletion of criminal data entities.
/// @dev This contract uses NatSpec for documentation and includes owner-only functions.
contract CriminalDataSender {
    /// @notice Sensitivity levels for criminal data
    enum Sensitivity {
        Low,
        Medium,
        High
    }

    /// @notice Structure of the criminal Entity
    /// @dev Entity structure to store criminal data
    struct Entity {
        string name;
        uint16 id;
        uint56 cnic;
        Sensitivity sensitivity;
        uint256 timeStamp;
    }
    /// @notice mapping to hold instances of criminal entity data
    mapping(uint56 => Entity) public criminalData;

    /// @notice mapping from cnic to Id
    mapping(uint56 => uint56) public cnicToID;

    /// @notice Address of the contract owner
    address public immutable owner; //state variable to store the address of the onwer

    /// @notice Count of criminals
    uint32 criminalCount = 1;

    /// @notice Event emitted when a new entity is created
    /// @param id The ID of the entity
    /// @param owner The address of the contract owner
    /// @param sensitivity The sensitivity level of the entity
    /// @param CriminalCount The current count of criminals
    event EntityCreated(
        uint16 id,
        address owner,
        Sensitivity sensitivity,
        uint32 CriminalCount
    );

    /// @notice Event emitted when an entity is retrieved
    /// @param id The ID of the entity
    event EntityRetrieved(uint16 id);

    /// @notice Event emitted when an entity is deleted
    /// @param _cnic The CNIC of the deleted entity
    event EntityDeleted(uint56 _cnic);

    /// @notice Event emitted when entity data is not found
    /// @param _cnic The CNIC for which data was not found
    event EntityDataNotFound(uint56 _cnic);

    /// @notice Constructor to set the owner of the contract
    /// @dev Sets the contract deployer as the owner
    constructor() {
        //his simply assign the address of the contarct to the owner after the contract is beign deployed
        owner = msg.sender;
    }

    /// @notice Modifier to restrict functions to the contract owner
    modifier onlyOwner() {
        require(msg.sender == owner); //this checks if the address of the account who called the contract is == to the add of the owner then its true
        _;
    }

    //.1==>
    /// @notice Function to create a new criminal entity
    /// @param _name The name of the criminal
    /// @param _id The ID of the criminal
    /// @param _cnic The CNIC of the criminal
    /// @param sensitivity The sensitivity level of the criminal
    /// @dev Adds a new criminal entity to the mapping and emits an EntityCreated event
    function CreateEntity(
        string memory _name,
        uint16 _id,
        uint56 _cnic,
        Sensitivity sensitivity
    ) public {
        criminalData[_id] = Entity(
            _name,
            _id,
            _cnic,
            sensitivity,
            block.timestamp
        );
        cnicToID[_cnic] = _id;
        criminalCount++;
        emit EntityCreated(_id, owner, sensitivity, criminalCount);
    }

    //.2==>
    /// @notice Function to return data of a criminal (can only be called by the owner)
    /// @param _cnic The CNIC of the criminal
    /// @return The criminal entity and a message if not found
    function getEntity(
        uint56 _cnic
    ) public view onlyOwner returns (Entity memory, string memory) {
        uint56 EntityId = cnicToID[_cnic];
        if (EntityId == 0) {
            return (
                Entity("", 0, 0, Sensitivity.Low, 0),
                "Criminal data not found"
            );
        }
        return (criminalData[EntityId], "");
    }

    //.3==>
    /// @notice Function to get all criminal entities (can only be called by the owner)
    /// @return An array of all criminal entities
    function getAllCriminals() public view onlyOwner returns (Entity[] memory) {
        require(criminalCount != 0, "data not found");
        Entity[] memory allCriminals = new Entity[](criminalCount);
        for (uint16 i = 0; i < criminalCount; i++) {
            allCriminals[i] = criminalData[i];
        }
        return allCriminals;
    }

    //.4==>
    /// @notice Function to delete a criminal entity of specified CNIC (can only be called by the owner)
    /// @param _cnic The CNIC of the criminal to delete
    /// @dev Deletes the criminal entity from the mapping and emits an EntityDeleted event
    function deleteEntity(uint56 _cnic) public onlyOwner {
        uint56 EntityId = cnicToID[_cnic];
        emit EntityDeleted(_cnic);
        delete criminalData[EntityId];
    }
}

